import React from 'react';
import Navbar from '../components/Navbar';
import '../styles/Home.css'; // Ensure this file exists and contains your styles

const Home = ({ cartItemCount }) => {
  return (
    <div>
      <Navbar cartItemCount={cartItemCount} />
      <div className="home-content">
        {/* Your existing Home component content */}
        <h1>Aesthetic Seasonal Arrivals</h1>
        <p>Shop the latest and greatest products at STRK N VMRT. Find deals on electronics, fashion, home goods, and more. Enjoy fast shipping and excellent customer service.</p>
      </div>
    </div>
  );
};

export default Home;
